import React from 'react';
import Header from './Header';

function HomePage() {
  const buttons = [
    { id: 1, label: 'Button 1' },
    { id: 2, label: 'Button 2' },
    { id: 3, label: 'Button 3' },
    { id: 4, label: 'Button 4' },
    { id: 5, label: 'Button 5' },
    { id: 6, label: 'Button 6' },
  ];

  const handleButtonClick = (buttonId) => {
    console.log(`Button ${buttonId} clicked`);
    // Add button click handler logic here
  };

  return (
    <div>
      <Header />
      <div style={styles.container}>
        <h1 style={styles.heading}>Home Page</h1>
        <div style={styles.buttonContainer}>
          {buttons.map((button) => (
            <button
              key={button.id}
              style={styles.button}
              onClick={() => handleButtonClick(button.id)}
            >
              {button.label}
            </button>
          ))}
        </div>
      </div>
    </div>
  );
}

const styles = {
  container: {
    padding: '20px',
    fontFamily: 'Arial, sans-serif',
    maxWidth: '1200px',
    margin: '0 auto',
    display: 'flex',
    alignItems: 'center',
    flexDirection: 'column',
    minHeight: 'calc(100vh - 300px)',
  },
  buttonContainer: {
    margin: '0 20%',
    width: '60%',
    display: 'flex',
    flexDirection: 'column',
    gap: '15px',
    marginTop: '30px',
    max
  },
  button: {
    padding: '12px 20px',
    backgroundColor: '#f5f5f5',
    color: '#333',
    border: '1px solid #ddd',
    borderRadius: '4px',
    cursor: 'pointer',
    fontSize: '16px',
    transition: 'all 0.3s ease',
  },
  buttonHover: {
    backgroundColor: '#e9e9e9',
  },
  heading: {
    color: '#333',
    textAlign: 'center',
    paddingBottom: '10px',
    borderBottom: '4px solid #9A2250',
    display: 'inline-block',
    margin: '20px auto',
    width: '100%',
    maxWidth: '300px',
    fontWeight: 'bold',
  },
};

export default HomePage;
